import React, {useEffect} from "react";
import { useAuth0 } from "./../../../../auth0/react-auth0-spa";
import {FromControl} from "react-bootstrap";
import "./nav-bar.scss"

const NavBar = (props) => {
  const { isAuthenticated, loginWithRedirect, logout } = useAuth0();


  return (
    <nav className="nav-bar">

      <ul className="main-nav left-nav">
        <li className="main-nav-item left-nav-item nav-item">
        </li>
      </ul>

      <ul className="main-nav center-nav">
        <li className="main-nav-item center-nav-item nav-item">
            <FormControl
            />


        </li>
      </ul>

      <ul className="main-nav right-nav">
        <li className="main-nav-item right-nav-item nav-item">
        </li>
        <li className="main-nav-item right-nav-item nav-item">
          {!isAuthenticated && (
          <button onClick={() => loginWithRedirect({})}>Log in</button>
          )}

          {isAuthenticated && <button onClick={() => logout()}>Log out</button>}
        </li>
      </ul>


    </nav>
  );
};

export default NavBar;
